import React, { useEffect, useState } from "react";
import { getBookings } from "../utils/api";
import "./BookingDetails.css";

const BookingDetails = () => {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    getBookings().then((res) => setBookings(res.data));
  }, []);

  return (
    <div className="booking-details">
      <h2>My Bookings</h2>
      {bookings.map((b) => (
        <div key={b.id} className="booking-info">
          <p><span>Room:</span> {b.roomName}</p>
          <p><span>Name:</span> {b.name}</p>
          <p><span>Email:</span> {b.email}</p>
          <p><span>Check-In:</span> {b.checkIn}</p>
          <p><span>Check-Out:</span> {b.checkOut}</p>
          <hr />
        </div>
      ))}
    </div>
  );
};

export default BookingDetails;
